import React, { Component } from 'react';
import './assets/tree.css'

export default () => {
    const data = [
        { id: 0, title: '河北', opened: 'open', checked: 'checked' },
        { id: 1, title: 北京, opened: 'open', checked: 'checked' },
        { id: 2, title: 上海, opened: 'open', checked: 'checked' }
    ]
    return (
        <ul className='tree'>
            <li className='tree-item'>
                <div className='tree-title'>
                    <div className='folder close' />
                    <div className='checkbox checked' />
                    <div className='item'>浙江</div>
                </div>
            </li>
        </ul>
    )
}
